import React, { Fragment } from "react";
import styled from "styled-components";

const Wrapper = styled.section`
	display: flex;
	justify-content: space-between;
	align-items: center;
`;

const WrapperMenu = styled.div`
	margin-top: 25px;
	display: flex;
	justify-content: center;
	align-items: center;
	text-align: center;
`;

const Menu = styled.p`
	text-align: center;
	font-size: 50px;
	font-family: "Quicksand";
	color: #87d3b8;
`;

const LogoImage = styled.img`
	padding: 10px 25px;
	height: 70px;
	width: auto;
`;

const LogoName = styled.img`
	padding: 10px;
	height: 37px;
	width: auto;
`;
const image = "../images/logo.png";
const name = "../images/giftu.png";

const Header = () => {
	return (
		<Fragment>
			<Wrapper>
				<LogoName src={name} />
				<WrapperMenu>
					<Menu>MENU</Menu>
					<LogoImage src={image} />
				</WrapperMenu>
			</Wrapper>
		</Fragment>
	);
};

export default Header;
